var foodItems,listElt=document.getElementById("list"),searchInput=document.getElementById("searchInput");function getFooodItems(){Aias.HTTP.GET("http://nutrimetrics.estellepicq.com/food?fodmaps=1","json").then(e=>{foodItems=e,this.displayList(foodItems)}).catch(e=>{console.log("error",e)})}function displayList(e){e.forEach((e,t)=>{var s=document.createElement("div");s.textContent=e.name,s.classList.add("item","displayed"),s.id="item_"+t,listElt.appendChild(s)})}getFooodItems(),searchInput.addEventListener("keyup",function(){var e=searchInput.value;foodItems.forEach((t,s)=>{var o=document.getElementById("item_"+s);t.name.toLowerCase().includes(e.toLowerCase())?o.classList.contains("displayed")||o.classList.add("displayed"):o.classList.remove("displayed")})});